import React from "react";
import { bgColor2e, bgColor5e , bgColorR2, bgColorGreen } from "../Styles/backGroundColor";
import { Headline } from "../Lable/HeadLines";
import { MonthlyPieChart } from "../Charts/monthlyPieChart";
import { exampleData } from "../Data/list";

export function PieChartComponent(props){
    const dataCopie = exampleData

    dataCopie.sort(function(a, b){
    if (a.date.year < b.date.year) return -1;
    if (a.date.year > b.date.year) return 1;
    if (a.date.month < b.date.month) return -1;
    if (a.date.month > b.date.month) return 1;
    if (parseInt(a.date.day) < parseInt(b.date.day)) return -1;
    if (parseInt(a.date.day) > parseInt(b.date.day)) return 1;
    return 0
    })

    const {bgColor=bgColor2e, lableBGColor=bgColor5e, piChartSize="300px", lableX="20%", lableY="10px", divWidth=500, divHeight=350,
           divBorderRadius="25px", data=[{x: "Ausgaben", y: parseFloat(dataCopie[dataCopie.length-1].bankBalance) + 0.001}, {x: "Einkommen", y: parseFloat(props.incomm) + 0.001}],
            piChartColors=[bgColorR2, bgColorGreen]}  = props

    return (
        <div className="Pi Chart" style={{position: "relative", transform:"flex", top:props.top, left:props.left, width:divWidth, 
                     height:divHeight, borderRadius:divBorderRadius, backgroundColor:bgColor}}>
            <div>
                <Headline width={piChartSize} left={lableX} top={lableY} text="Diesen Monat" color={lableBGColor}/>
            </div>
          <MonthlyPieChart data={data} colors={piChartColors} borderColor={bgColor}zz/>
        </div>
    )}
